const MyButton = ({onClick, children }) => {
    return (
        <button
            onClick={onClick}
            style={{
                width: '80%',
                padding: '10px 20px',
                borderRadius: '10px',
                color: '#fff',
                backgroundColor: '#1886E5',
            }}
        >
            {children}
        </button>
    );
};
